// 컴포넌트 생성

function Nav() {
    return (
        <nav>
            <ul>
                <li>
                    <a href="/sub/html">html</a>
                </li>
                <li>
                    <a href="/sub/css">css</a>
                </li>
                <li>
                    <a href="/sub/js">js</a>
                </li>
            </ul>
        </nav>
    );
}

function Article() {
    return (
        <article>
            <h2>타이틀</h2>
            Hello, React!
        </article>
    );
}

function App() {
    return (
        <div className="root">
            <Header />
            <Nav />
            <Article />
        </div>
    );
}

export default App;
